import { Component } from "react";
import { Switch, Route } from "react-router-dom";

// all component
import Header from './component/Header';

export default class App extends Component{
  render(){
    return(
      <React.Fragment>
        <Switch>
        <Route exact path="/" component={Header} />
        </Switch>
      </React.Fragment>
    )
  }
}
